import axios from 'axios';

const URL = 'http://localhost:8888';


const testimonialAPI = axios.create({
  baseURL : URL,
});

export const fetchSomeData = async() => {
  try{
    const response = await testimonialAPI.get('wp-json/wp/v2/testimonios');
    return response.data;
  } catch (error) {
    throw error;
  }
};
